Estos últimos meses han sido difíciles para todos. La aviación se vio terriblemente afectada por la pandemia global y todos comenzamos a temer por nuestros empleos y, más importante, por nuestra salud. Pero seguimos trabajando, siempre con una sonrisa detrás del cubrebocas y con nuestra mejor actitud. 

Cuando te dan la noticia, de la noche a la mañana, de que has perdido tu empleo, sientes cómo te invade una tristeza y preocupación porque ya no tendrás un ingreso fijo para solventar tus gastos y mantener a tu familia, ya no podrás usar ese uniforme que portabas con orgullo y tendrás que dejar tu trabajo soñado. 

Pero quiero que te tomes un momento, respires muy profundo y recuerdes que los malos momentos no son eternos, que siempre después de la tempestad viene la calma. Volveremos a soñar, a sonreír, volveremos a volar, y esta vez más alto, con mayor orgullo y felicidad.

Por: JazRojo.
